#* {{quote-book|fr|year=1606|author=Jean Sarrasin|title=Le Citadin de Genève, ou Response av Cavalier de Sauoye|pageurl=http://books.google.com/books?id=8Xo7AAAAcAAJ&hl=en&pg=PR238|page=238
|passage=Que iamais il ne procedera & ne porra , ni ne deura proceder à aucun traité auec ledit Sieur Duc , ''ad aliquem tractum cum præfato Domino Duce Sabaudiæ , ſuiſue ſucceſſoribus'' , or auec autre quelconques , de quelque degré , eſtat , dignité , '''præeminence''' & condition qu’il puiſſe eſtre , ni à aucun eſchange ou alienation de la Cité , fauxbourgs , territoire , Iuriſdiction & Seigneurie ſans l’expres conſentement & volonté des Syndiques & Procureurs Citoyens & Bourgeoys qui sont, & qui seront, ains qu'il s’opposera luy & ses successeurs contre qui que ce soit, qui directement ou indirectement procureroit telle alienation & eschange de Iurisdiction, ou qui l’impetreroit, ou qui feroit quelque acte par lequel directement ou indirectement on y pourroit tomber, ou qu’occasion en seroit presentée.}}
